var verticalOrder = {"A":1, "G":2, "I":3, "L":4, "V":5, "C":6, "M":7, "S":8, "T":9, "P":10, "F":11, "W":12, "Y":13, "H":14, "K":15, "R":16, "D":17, "E":18, "N":19, "Q":20, "-":21, "X":22}

function shuffle(array) {
  var currentIndex = array.length
    , temporaryValue
    , randomIndex
    ;

  // While there remain elements to shuffle...
  while (0 !== currentIndex) {

    // Pick a remaining element...
    randomIndex = Math.floor(Math.random() * currentIndex);
    currentIndex -= 1;

    // And swap it with the current element.
    temporaryValue = array[currentIndex];
    array[currentIndex] = array[randomIndex];
    array[randomIndex] = temporaryValue;
  }

  return array;
}

function enter(event) {
    var activeLineNumber = this.data.number
    console.log("activeLineNumber = " + activeLineNumber)
    var activeLines = fullPaths[activeLineNumber].members
    activeLines.forEach(function(l) {
        l.bringToFront();
        l.strokeColor = 'red';
        l.strokeWidth = 4
        l.opacity = 1;
    })
}
function leave(event) {
    this.layer.children.map(function(d) {
        d.strokeColor = d.data.colour
        d.strokeWidth = 3
        d.opacity = 0.02
    })
}

var colours = {"A": "#7fc97f", "B": "#fdc086"}
var fullPaths = new Object
shuffle(data)
for ( var i = 0; i < data.length; i++ ) {
    var colour = colours[data[i].group]
    console.log(colour)
    fullPaths[i] = { colour: colours[data[i].group], members: new Array }
    var xOffset = 0
    var yOffset = 0
    var p = new Path()
    p.data.number = i
    fullPaths[i].members.push(p)
    p.strokeWidth = 3
    p.strokeColor = colour
    p.data.colour = colour
    p.opacity = 0.02
    p.onMouseEnter = enter
    p.onMouseLeave = leave
    for ( var j = 0; j < data[i].aminoAcids.length; j++ ) {
        if ( j > 0 && j%100 == 0 ) {
            xOffset += 1400
            yOffset += 100
            var p = new Path()
            p.data.number = i
            fullPaths[i].members.push(p)
            p.strokeWidth = 3
            p.strokeColor = colour
            p.data.colour = colour
            p.opacity = 0.02
            p.onMouseEnter = enter
            p.onMouseLeave = leave
        }
        var x = j*14 - xOffset
        var y = yOffset + verticalOrder[data[i].aminoAcids[j]]*4
        p.add(new Point(x,y))
    }
}
